settingsSaved.message:
Asenna AudD-laajennus ja napsauta sen kuvaketta tunnistaaksesi nykyisellä välilehdellä toistettava kappale.
Katso yllä oleva video nähdäksesi, kuinka se toimii.

AudD-laajennus:
- Tunnistaa selaimessasi soivan musiikin;
- Löytää musiikkia AudD-tietokannasta, jossa on yli 75 miljoonaa kappaletta musiikintunnistusteknologiansa avulla;
- Näyttää sanoitukset tunnistetuille kappaleille;
- Näyttää linkkejä Apple Musicin, Spotifyn, Deezerin, YouTube Musicin kappaleiden kuuntelemiseksi;
- Näyttää tarkan hetken tunnistetussa kappaleessa, kun selaimen ääntä toistetaan.

Music Recognition API: https://audd.io
Lähdekoodi: https://github.com/AudDMusic/chrome-extension

Laajennus toimii AudD® Musicin tunnistussovellusliittymällä

Luonut ja suunnitellut AudD.io-tiimi Eric Starkin, Mitchell Kossorisin ja Ivan Kasatkinin avustuksella.
